// Estructura de DB para Usuario
const orders = [
    {
    status:undefined,
    order:undefined,
    date:undefined,
    reference:undefined,
    code:undefined,
    skuName:undefined,
    lot:undefined,
    value:undefined,
    discount:undefined,
    points:undefined,
    price:undefined,
    shipping:undefined,
    totalPay:undefined,
    discountName:undefined,
    customer:undefined,
    dni:undefined,
    phone:undefined,
    state:undefined,
    city:undefined,
    divipola:undefined,
    neighborhood:undefined,
    address:undefined,
    addAddress:undefined,
    deliveryOnName:undefined,
    slaType:undefined,
    estimatedShippingDate:undefined,
    ansDelivery:undefined,
    oderDate:undefined,
    stock:undefined,
    guide:undefined,
    dispatch:undefined,
    carrier:undefined,
    trakingUrl:undefined,
    invoice:undefined,
    invoiceUrl:undefined,
    observations:undefined,
    unit:undefined,
    employee:undefined
}]

//se pasa un estado por defecto para definicion de estructura
function Orders(state = [], action){
    //console.log("DaoOrders");
    var NewState = Object.assign([],state);
    if(action.type == "loadOrders"){
        action.data.forEach(function (doc) {
            var newObj = Object.assign(doc);
            NewState.push({dates:newObj});
        });
        console.log(NewState);
        return NewState;
    }
    else return NewState;
}

const DaoOrders = {Orders}

export default DaoOrders;
